import React,{lazy,Suspense} from "react";
import {Route,HashRouter,Redirect,Switch,Link} from 'react-router-dom';
const SingleProduct = lazy(()=>import('../SingleProduct/SingleProduct'));
const ProductCards = lazy(()=>import('../ProductCards/ProductCards'));
export default function Menu(){
    return(
        <div className="menu">
                     <ul className="menu-items">
                        <li href="/product"><Link>ViewProduct</Link></li>
                      </ul>
                      <div className="mb-50">
                      <Suspense fallback="Loading..."> 
                        <HashRouter>  
                          <Switch>
                            <Route path="/" exact component={ProductCards}  />
                            <Route path="/product" component={SingleProduct}  />
                            <Redirect to ='/' />
                          </Switch>
                        </HashRouter>
                  </Suspense>
                  </div>
                </div>

    );
}
